    <p class = "Text">AWS Certified Developer – Associate <br/>
                    Amazon Web Services Training and Certification <br/>
                    Expires: October 12, 2026 <br/>        
        </p>
    </div>
}
*/

export {aboutMe,Education,Certifications,WorkExperience};
